(function($){
  $(document).ready(function(){

    // Reset the table width to
    // To be more responsive friendly
    if($("table").length) {
      $("table:not(.gsc-search-box):not(.gsc-search-box table)").not(".section--course-listing table").not(".no-footable").each(function(){
        var $tableWidth = $(this).css("width");

        if(!$(this).hasClass("js-processed")) {
          $(this).addClass('footable table js-processed breakpoint-lg');
          $(this).find("thead th:not(:first-child)").attr("data-breakpoints", "xs ");
        }

        // intercept WYSIWYG inline style and set it as max width so it is flexible
        $(this).css({
          'width' : '100%',
          'max-width' : $tableWidth
        });
      });
    }
  });
})(jQuery);
;
(function($){
  $(function(){
    $('.footable').footable({
      "useParentWidth": true,
      "on": {
        'postdraw.ft.table': function(e, ft) {
          $('.footable-' + ft.id).wrap('<div class="footable-wrap"></div>');
        }
      }
    });
    $('.no-footable').wrap('<div class="footable-wrap"></div>');
  });
})(jQuery);
